import React, { Component } from 'react'
import NavBar from './NavBar'
import Footer from './Footer'

const h4={
  fontSize:'15px'
}

 class Hero extends React.Component {
  render() {
    return (
      <>
      <NavBar />
      <div class="row home-row">
          <div class=" col-md-6 home-colom">
            <h4>Who are We</h4>
          </div>
          <div class="col-md-6 home-colom">
            <h4>Our Solution</h4>
          </div>
        </div>
      <Footer />
      </>
    )
  }
}

export default Hero
